// Compiler result to JSON file
import { createComponent } from 'js/declViewModelService';
import { registerDynImportEntry } from 'js/moduleLoader';
import AwParseService from 'js/awParseService';
import AwFilterService from 'js/awFilterService';
import { getField } from 'js/utils';
import { Fragment } from 'react';
let filterSer = AwFilterService.instance;



/*
render function
*/
import { awCommandListRenderFunction } from 'js/AwCommandListService';


/*
ctx imports
*/
import { getCommandStates as commandDisplays } from 'js/command.service';
const ctxImportObj = { commandDisplays };


/*
dynamic import
 */
registerDynImportEntry('js/AwCommandListService', () => import('js/AwCommandListService'));;

/*
view model
 */
const declViewModelJson = {
    "schemaVersion": "1.0.0",
    "data": {
        "_overflownCommands": {},
        "_swfCommandBarComponent": true
    },
    "actions": {
        "render": {
            "method": "awCommandListRenderFunction",
            "deps": "js/AwCommandListService",
            "options": {
                "elementRefList": [
                    "commandBarMain"
                ]
            }
        },
        "overflowPopup": {
            "actionType": "popup",
            "options": {}
        }
    },
    "ctx": {
        "commandDisplays": {
            "parser": {
                "method": "getCommandStates",
                "deps": "js/command.service"
            }
        }
    },
    "lifecycleHooks": {
        "render": "render"
    },
    "i18n": {
        "MORE_LINK_TEXT": [
            "BaseMessages"
        ],
        "LESS_LINK_TEXT": [
            "BaseMessages"
        ],
        "NO_COMMANDS_TEXT": [
            "BaseMessages"
        ],
        "MORE_BUTTON_TITLE": [
            "BaseMessages"
        ]
    },
    "_viewModelId": "AwCommandList",
    "_uniqueViewModelId": "AwCommandList"
};




/*
define component
*/
const Component = createComponent( declViewModelJson, awCommandListRenderFunction, {"elementRefList":["commandBarMain"]}, ctxImportObj );

export default Component;
